// Assuming Test.js has been created as instructed previously

// Update your imports in App.js to include the Test component
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import DashboardContainer from './components/DashboardContainer';
// Remove or comment out the imports for GradingPage and DashboardPage if not used
// import DashboardPage from './pages/DashboardPage';
// import GradingPage from './pages/GradingPage';
import Test from './pages/Test'; // Import the Test component

function App() {
  return (
    <Router>
      <DashboardContainer>
        <Routes>
          {/* Set Test as the default landing page */}
          <Route path="/" element={<Test />} />

          {/* Optionally, comment out or remove the routes you're not using */}
          {/* <Route path="/dashboard" element={<DashboardPage />} />
          <Route path="/grading" element={<GradingPage />} /> */}
        </Routes>
      </DashboardContainer>
    </Router>
  );
}

export default App;
